    class E(C, B):
        load = Field(default='E')

    self.assertEqual(E(save='X')['save'], 'X')
    self.assertEqual(E(load='X')['load'], 'X')
    self.assertEqual(E.fields, {'save': {'default': 'C'},
        'load': {'default': 'E'}, 'update': {'default': 'C'}})

